import PokemonIcon from "@mui/icons-material/Pets"; // Cambiado por un icono más relevante
import { AppBar, Container, Toolbar, Typography } from "@mui/material";
import React, { useState } from "react";

function Header() {
  const pages = ["Pokedex", "Movimientos", "Habilidades"];
  const settings = ["Perfil", "Cerrar Sesión"]; // Actualizado para reflejar opciones más relevantes
  const [anchorElNav, setAnchorElNav] = useState(null);
  const [anchorElUser, setAnchorElUser] = useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };
  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: "black" }}>
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <PokemonIcon sx={{ display: { xs: "none", md: "flex" }, mr: 1 }} />
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: "none", md: "flex" },
              fontFamily: "monospace",
              fontWeight: 700,
              letterSpacing: ".3rem",
              color: "inherit",
              textDecoration: "none",
            }}
          >
            Concoce los pokemons
          </Typography>

          {/* Menús y más configuraciones aquí... */}
        </Toolbar>
      </Container>
    </AppBar>
  );
}

export default Header;
